import React, { Component } from 'react';
import { MyContext } from './App';

export default class MyProvider extends Component {

    state = {
    newsBoolean: false
}
render(){
    return (
        <MyContext.Provider value={this.state.newsBoolean}>
            {this.props.children}
        </MyContext.Provider>
    )
}

}
